INSERT INTO `ps_category_lang` VALUES (1,1,1,'Baza','','baza','','',''),(2,1,1,'Kategorie','<p>Znajdziesz u nas szeroką oferte produktów związanych z oświetleniem.</p>','kategorie','','',''),(11,1,1,'LED gwint E14','<p>W tej kategorii znajdują się najlepsze <strong>żarówki LED E14</strong>. Jeśli szukają Państwo żarówek typu świeczka czy kulka na gwint E14, w naszym sklepie odnaleźć można wiele niezawodnych rozwiązań tego typu. Kształt <strong>żarówki E14</strong> jest dosyć popularny, dlatego przy dokonywaniu ostatecznego wyboru liczą się szczegóły. Żarówka E14 – niewielki gwint, wiele możliwości.</p><p> </p><p><strong>Żarówka LED E14</strong> jest potocznie nazywana „małym gwintem”. W zależności od modelu, posiada ona zróżnicowanie barw od 2700K do 6500K, dlatego biorąc pod uwagę nasze upodobania, możemy wybrać żarówkę emitującą światło o barwie ciepłej, dziennej, neutralnej lub zimnej.</p><p><strong>Żarówki LED E14</strong> dostępne w naszym sklepie różnią się mocą – od 2W do 9W. Najpopularniejsze kształty źródeł światła tego typu to świeczki, corn oraz mała kulka. Gwint żarówki E14 jest mniejszy od standardowego formatu (E27) i jest wykorzystywany m.in. w kinkietach, lampkach sypialnych i stołowych, zarówno w biurach jak i domach prywatnych.</p>','led-gwint-e14','','',''),(12,1,1,'LED gwint E27','<p>Jednym z najpopularniejszych źródeł światła w Polsce są <strong>żarówki </strong>gwintowane o dużym trzonku. <strong>Żarówki LED E27</strong>, które możecie znaleźć poniżej, będą idealnym substytutem standardowych, żarowych jak i halogenowych źródeł światła. Wykorzystanie żarówki działającej w oparciu o diody <strong>LED</strong> to nie tylko dbałość o środowisko, ale i możliwość zaoszczędzenia, ze względu na nawet 90% mniejszy pobór prądu w porównaniu do tradycyjnych źródeł światła. Poniżej dostępne są żarówki z gwintem E27 renomowanych marek <strong>Kanlux</strong>, <strong>OSRAM</strong>, <strong>Philips Lighting</strong>, <strong>INQ</strong> i wielu innych.</p><p>Sprawdź również żarówki LED E14 – żarówki na małym gwincie.</p>','led-gwint-e27','','',''),(13,1,1,'LED gwint E40','LamPy - LED gwint E40','led-gwint-e40','','',''),(14,1,1,'LED 230V GU10 MR11 i MR16','<p>Oprawki nastawne instalowanie w stropie są najczęściej spotykane w kuchniach i łazienkach. Wymagają one jednakowoż specjalnego rodzaju <strong>żarówek ledowych</strong>. Są to modele wyposażone w trzonek <strong>GU10</strong>. Poniżej oferujemy bogaty wybór<strong> źródeł LED</strong> zasilanych prądem o napięciu <strong>230V</strong>.</p><p>Żarówki LED GU10 to doskonały sposób na oświetlenie pomieszczenia w sposób efektywny i oszczędny. Oświetlenie dowolnego pomieszczenia nigdy nie było tak proste. <strong>Żarówki LED GU10</strong> są ekologicznym rozwiązaniem, które nie wymaga stosowania transformatora ze względu na zasilanie wynoszące 230 V. Rosnąca popularność żarówek LED sprawiła, że trzonek taki jak GU10 jest jednym z częściej stosowanych rodzajów w wielu oprawach oświetleniowych.</p>','led-230v-gu10-mr11-i-mr16','','',''),(15,1,1,'LED 230V GU10 AR111','<p>Wszelkiego rodzaju oprawki wpuszczane wymagają wykorzystania żarówek o specjalnym trzonku. Do wielu opraw instalowanych w stropie potrzebne są <strong>żarówki LED</strong> zasilane napięciem <strong>230V</strong>, osadzonych na trzonku <strong>GU10</strong> i kształcie bańki AR111. Poniżej prezentujemy szereg tego typu źródeł GU10 AR111 o różnej mocy, kolorze jaki i kącie świecenia.</p>','led-230v-gu10-ar111','','',''),(16,1,1,'LED 12V G53 AR111','<p>W naszym sklepie odnajdą Państwo wszelkiego typu energooszczędne źródła światła <strong>LED</strong>. Poniżej oferujemy <strong>żarówki </strong>zasilane napięciem <strong>12V</strong> z trzonkiem <strong>G53</strong>. Różnią się między sobą producentam, mocą świecenia, kątem. Uwaga, <strong>nie zawsze większa moc oznacza więcej światła, to zależy od strumienia!</strong></p>','led-12v-g53-ar111','','',''),(17,1,1,'LED 12V MR16 GU5,3','<p>Asortyment naszego sklepu bogaty jest we wszelkiego rodzaju<strong> ledowe źródła światła</strong>. Poniżej prezentujemy energooszczędne <strong>żarówki G5,3 MR11 i MR16 </strong>zasilane napięciem <strong>12V</strong>. Poszczególne modele różnią się między sobą barwą światła, mocą świecenia i kątem padania światła.</p><p>W tej kategorii dostępne są również żarówki z systemu Philips Hue.</p>','led-12v-mr16-gu53','','',''),(18,1,1,'LED 230V G9','<p>Poszczególne oprawy różnią się od siebie nie tylko kształtem czy mocą, ale także rodzajem wymaganej <strong>żarówki</strong>. Poniżej prezentujemy źródło <strong>LED </strong>zasilane prądem o napięciu <strong>230V </strong>osadzone na trzonku <strong>G9</strong>. </p>','led-230v-g9','','',''),(19,1,1,'LED 12V G4 sztyft','<p>Poniżej oferujemy szereg ledowych źródeł światła zasilanych napięciem <strong>12V</strong>. Poniższe żarówki osadzono na trzonku G4. Ich produkcją zajmują się firmy <strong>Kanlux</strong>, <strong>Brilum </strong>i <strong>Osram</strong>.</p>','led-12v-g4-sztyft','','',''),(20,1,1,'Świetlówki LED TUBE','<p>Poniżej prezentujemy świetlówki <strong>LED TUBE</strong>. Oferujemy <strong>świetlówki LED </strong>o mocy od 8W do 37W. Dostępne są modele o różnej długości będące bezpośrednimi zamiennikami tradycyjnych świetlówek liniowych. Znajdziesz u nas między innymi odpowiedniki LED dla świetlówek <strong>T5 </strong>i <strong>T8 </strong>o mocy 18W (60cm), 36W (świetlówki LED120cm) czy 58W (150cm). <strong>Modele o oznaczeniu EM jak i 230V w specyfikacji produktu działają bezpośrednio na napięciu sieciowym</strong>, natomiast <strong>tuby LED</strong> z oznaczeniem <strong>HF</strong> (High Frequency) producentów OSRAM i Philips <strong>działąją ze statecznikami elektronicznymi</strong> EVG. Zachęcamy do zapoznania się z produktami najlepszych producentów, w tym ABB, Bemko, ELGO, Kanlux, HoldBox i innych.</p>','swietlowki-led-tube','','',''),(21,1,1,'LED pozostałe','<p>Obecnie na rynku znaleźć można wiele różnych energooszczędnych źródeł <strong>LED</strong>. Podstawowe z nich to <strong>żarówki LED GU10, </strong>jednak przygotowaliśmy dla Państwa również mniej standardową ofertę. Poniżej prezentujemy wersje lamp na trzonkach <strong>G24 </strong>(wersja dwupinowa oraz 4-o pinowa) oraz z mocowaniem typu <strong>GX53</strong>.</p>','led-pozostale','','',''),(22,1,1,'Tradycyjne źródła światła','<p>W naszej ofercie znajdą Państwo <strong>źródła światła</strong> każdego rodzaju. Poniżej oferta obejmująca <strong>halogeny</strong>, <strong>świetlówki</strong>, źródła światła żarowe, a także <strong>lampy wyładowcze</strong>, w tym sodowe i <strong>metalohalogenowe</strong>.</p><p>Zachęcamy do zapoznania się z szeroką ofertą sklepu luxmarket.pl. Oprócz tradycyjnych źródeł światła oferujemy również inne rozwiązania, w tym żarówki LED E14, E27, E40, świetlówki LED TUBE i wiele innych.</p>','tradycyjne-zrodla-swiatla','','',''),(23,1,1,'Lampy wyładowcze','<p>W naszym sklepie odnajdą Państwo także bogaty wybór lamp wyładowczych. Poniżej znaleźć można modele o różnej mocy i gwincie. Dostępne są <strong>lampy wyładowcze</strong> zarówno <strong>40W</strong>, <strong>250W </strong>czy <strong>400W</strong>. Ponadto, sprzedajemy<strong> lampy sodowe </strong>i <strong>metahalogenowe</strong>.</p>','lampy-wyladowcze','','',''),(24,1,1,'Świetlówki energooszczędne','<p>Serdecznie zapraszamy Państwa do zapoznania się z ofertą naszego sklepu. Znaleźć tu można wszelkiego rodzaju <strong>świetlówki</strong>. Oferujemy modele <strong>liniowe</strong>, energooszczędne osadzone na trzonku <strong>E14 </strong>i <strong>E27</strong>, a także <strong>pinowe</strong>. Ponadto, sprzedajemy <strong>świetlówki specjalistyczne</strong> do akwariów, terrariów czy mięsa. Kupicie u nas źródła kołowe, kolorowe i w wielu innych kształtach.</p>','swietlowki-energooszczedne','','',''),(25,1,1,'Świetlówki liniowe i kołowe','<p>Poniżej oferujemy Państwu duży zbiór <strong>świetlówek liniowych </strong>wiodoących producentów takich jak OSRAM czy Philips. Oferujemy źródła o różnej mocy - od 4W, poprzez popularne <strong>świetlówki 18W</strong> i <strong>36W T8</strong> aż do mocy 80W T5. Świetlówki dostępne są także w różnych wymiarach i o barwie światła od ciepłej, poprzez neutralną do zimnej 6500K wzwyż. Dla grafików jak i osób pracujących w warunkach wymagających jak najlepszego oddaania barw polecamy świetlówki Philips Graphica jak i OSRAM Color Proof o barwie 5000K.</p>','swietlowki-liniowe-i-kolowe','','',''),(26,1,1,'Żarówki żarowe','<p>W naszym sklepie znajdą Państwo także szereg <strong>żarowych źródeł światła</strong>. Poniżej prezentujemy kilka rodzajów żarówek  o różnej mocy i gwincie. Oferujemy <strong>żarówki halogenowe</strong>, <strong>rurkowe </strong>oraz <strong>świecowe</strong>. W porównaniu do ledowych źródeł światła, owe żarówki cechują się bardzo niską ceną.</p>','zarowki-zarowe','','',''),(27,1,1,'Żarówki halogenowe','<p>Poniżej znajdą Państwo zbiór halogenowych źródeł światła. Są tu żarówki zasialne napięciem 12 oraz 230V. Dodatkowo znajdziecie tutaj żarówki halogenowe Par i specjalistyczne źródła firmy <strong>Osram</strong>. Halogenowe żarówki produkują również marki <strong>Kanlux</strong>, <strong>Spotline</strong> czy <strong>Paulmann</strong>.</p>','zarowki-halogenowe','','',''),(70,1,1,'Źródła światła','<p>i akcesoria. Oferujemy produkty wiodących marek takich jak Kanlux, Osram, i innych.</p><p> </p><p>E40 i wiele, wiele innych. Poniżej znaleźć można również źr4ódła światła wchodzące w skład systemu inteligentnego Philips Hue.</p>','zrodla-swiatla-led','','',''),(71,1,1,'Oprawy domowe','<p>Oferujemy szeroką gamę <strong>opraw wewnętrznych</strong> działających przy użyciu nowoczesnej, energooszczędnej technologii LED. Znajdą w niej Państwo różnego rodzaju <strong>lampy domowe</strong>, w tym <strong>kinkiety (kinkiet led)</strong>, lampy biurkowe i meblowe, <strong>halogeny sufitowe LED</strong>, a także <strong>oczka LED podtynkowe</strong> lampki biurkowe LED, <strong>kinkiety łazienkowe</strong>, panele czy oprawy schodowe umożliwiające wydajne oświetlenie wnętrza domu i mieszkania. W tym miejscu znajdą Państwo także oświetlenie do łazienki, w której dużą grupę stanowią lampy sufitowe wpuszczane o podwyższonej szczelności. Sprawdzone marki <strong>Britop</strong>, Kanlux, Orno i nie tylko. W osobnej kategorii oferujemy również funkcjonalne wentylatory sufitowe z oświetleniem <strong>Westinghouse </strong>i wiele więcej.</p>','oprawy-domowe-led','','',''),(72,1,1,'Oprawy schodowe','<p><strong>Oświetlenie schodów wewnętrznych i zewnętrznych</strong> wymaga zastosowania nowoczesnych rozwiązań. Dzięki wykorzystaniu zdobyczy <strong>technologii LED</strong> możemy uzyskać doskonałe efekty, jak chodzi o efekt wizualny, komfort mieszkańców, a także niski pobór energii elektrycznej. <strong>Nowoczesne oświetlenie schodowe</strong> pozwala podkreślić koncepcję architektoniczną oraz oświetlić ciągi komunikacyjne dla wygody i bezpieczeństwa domowników.</p>','oprawy-schodowe-led','','',''),(73,1,1,'Plafony oświetleniowe','LamPy - Plafony oświetleniowe','oprawy-plafony-led','','',''),(74,1,1,'Kinkiety domowe','<p><strong>Kinkiety </strong>są niezawodne przy tworzeniu nastroju w pomieszczeniu za pomocą światła. Doskonale sprawdzają się w sypialniach czy łazienkach – i nie tylko. W naszej ofercie znajdą Państwo energooszczędne,<strong> nowoczesne kinkiety LED</strong> w najróżniejszych kształtach, wymiarach i kolorach, wykonane z różnego rodzaju materiałów, wśród których z pewnością można będzie znaleźć te najlepiej pasujące do charakteru danego wnętrza. Sprawdź również inne oprawy oświetleniowe do domu, w tym lampki biurkowe LED, plafony oświetleniowe, lampy ścienno-sufitowe, lampy stojące.</p>','kinkiety-domowe','','',''),(75,1,1,'Lampy ścienno-sufitowe','<p>Jednym z kluczowych elementów remontu pomieszczenia, jest nie tylko wybór odpowiedniego oświetlenia, ale przede wszystkim jego rozmieszczenie. Zaplanowanie oświetlenia, które będzie przede wszystkim funkcjonalne i skuteczne często spędza sen z powiek wykonawców i inwestorów. Wśród opraw, których nie może zabraknąć znajdują się lampy sufitowe i ścienne. Rozwiązaniem uniwersalnym są lampy ścienno-sufitowe, które znajdą Państwo w katalogu produktów oferowanych w sklepie LamPy</p><h3>Lampa LED sufitowa</h3><p>Lampa LED sufitowa to oprawa, która pozwoli na doskonale oświetlenie przestrzeni przy zachowaniu maksymalnie długiej żywotności źródła światła, bez konieczności jego wymiany przez długie lata. Ponadto, Lampa LED- sufitowa lub ścienna doskonale sprawdza się w instalacjach, w których zaplanowano montaż ściemniacza. Przydymione światło to nie tylko zwiększenie oszczędności, ale także możliwość dowolnej manipulacji natężeniem światła w zgodzie z naszym nastrojem.</p><p>Zdecydowanie <strong>więcej produktów</strong> z tej kategorii znajdziesz<strong> w naszym drugim sklepie www.OtoLampy.pl </strong><br /> </p>','lampy-scienno-sufitowe_led','','',''),(76,1,1,'Oczka podtynkowe','<p>W naszej ofercie znajdą państwo <strong>oczka podtynkowe</strong>, a wśród nich między innymi<strong> oprawy dekoracyjne</strong>, <strong>nastawne </strong>i stałe, a także oprawy typu <strong>downlight</strong>. Wszystkie prezentowane w tej kategorii modele działają w oparciu o technologię LED, stanowiąc energooszczędne, trwałe oświetlenie bez potrzeby częstej wymiany żarówek.</p><p>Oferujemy uniwersalne i praktyczne oprawki Kanlux Argus i wiele innych. Zapraszamy do zapoznania się z poniższym asortymentem.</p>','oczka-podtynkowe-led','','',''),(77,1,1,'Oprawy meblowe','<p><strong>Źródła LED</strong> gwarantują oszczędność energii elektrycznej, a także są bardzo wydajne. Działają przez długi czas, bez ingerencji użytkownika. Sprawdzają się nie tylko jako oświetlenie, ale również jako dekoracja. W naszej ofercie znajdują się <strong>oprawy LED</strong> do podświetlania mebli: półek, szafek, blatów i innych powierzchni, którym chcemy nadać niepowtarzalny wygląd lub oświetlić dla wygody użytkowania.</p>','oprawy-meblowe-led','','',''),(78,1,1,'Lampki biurkowe','<p>Lampka biurkowa jest akcesorium niezbędnym zarówno w pokoju ucznia, jak i domowym gabinecie. Jej najważniejszą funkcją jest zapewnienie źródła światła podczas pracy i nauki. Lampa na biurko powinna umożliwiać regulację swojego położenia, kąta padania światła i wysokości. Przydatna jest także możliwość zmiany natężenia oświetlenia i temperatury barwowej, by długotrwałe korzystanie z lampki nie męczyło wzroku. W ofercie sklepu LamPy znajdą Państwo bardzo szeroki wybór różnych typów lampek biurkowych, m.in. <strong>lampy biurkowe z klipsem, </strong>lampy, które umożliwiają wyginanie w różnych kierunkach, <strong>oprawy biurkowe </strong>wyposażone w gniazdo USB, do ładowania telefonów komórkowych a nawet takie, które łączą się z aplikacją smartfona i można np. sterować nimi za pomocą głosu.</p>','lampki-biurkowe-led','','',''),(79,1,1,'Oprawy dekoracyjne','<p><strong>Oświetlenie</strong> LED daje doskonałe możliwości <strong>dekoracyjne</strong> - przede wszystkim umożliwia stworzenie niesamowitych iluminacji. W naszym sklepie znajdziesz <strong>kurtyny świetlne</strong> LED jak i sople LED zewnętrzne, również w wersji migającej Flash, którymi ozdobisz elewację swojego domu wprowadzając świąteczny klimat. Dekoracje zewnęrzne domu są równie ważne jak i te do domu, dlatego nie zapominajmy o ozdobieniu mieszkania i drzewka świątecznego ubierając <strong>lampki choinkowe</strong> dostępne w klasycznym ciepłym białym kolorze jak i <strong>lampki choinkowe kolorowe</strong>.</p>','oprawy-dekoracyjne','','',''),(80,1,1,'Oprawy łazienkowe','<p>Poniżej prezentujemy ofertę lamp łazienkowych przeznaczonych do pracy w miejscach o zwiększonej wilgotności. Wśród nich można odnaleźć <strong>oprawy hermetyczne</strong> o podwyższonej szczelności, <strong>plafony</strong>,  <strong>kinkiety łazienkowe</strong> i oprawy szklane, które doskonale wpasują się w wystrój łazienki oraz lampy sufitowe wpuszczane do montażu w łazienkach, w których wykorzystano podwieszany sufit.</p>','oprawy-lazienkowe','','',''),(81,1,1,'plafony sufitowe','<p><strong>Plafony LED</strong> to rodzaj opraw, które doskonale sprawdzają się zarówno w łazienkach, jak i przedpokojach. Szeroki wybór plafonów pozwala na ich dopasowanie do każdej aranżacji, zarówno bardzo klasycznej, jak i nowoczesnej stosując kolorowe obwódki czy transparentne klosze prezentujące ozdobną żarówkę.</p><h3>Plafony LED w ofercie LamPy</h3><p>Oferta naszego sklepu bogata jest we wszelkiego rodzaju <strong>plafony </strong>i plafoniery. Poniżej przedstawiamy <strong>lampy </strong>funkcjonujące dzięki energooszczędnym żarówkom <strong>LED</strong>. Są to oprawy do montażu natynkowego na ścianie, bądź suficie. Ich produkcją zajmują się firmy <strong>Anlux</strong> oraz <strong>eLux</strong>.</p>','plafony-sufitowe-led','','',''),(82,1,1,'plafony hermetyczne','<p><strong>Plafoniery hermetyczne LED</strong> moża stosować <strong>zarówno w środku w pomieszczeniach jak i na zewnątrz.</strong> Odporne są one nie tylko na dostanie się wody i pyłu, ale również, co może nawet ważniejsze, przed wszelkimi owadami. Hermetyczność może być różna i zależy od stopnia szczelności, im wyższy stopień tym bardziej szczelna jest oprawa. Tu można znaleźć oprawy od stopnia IP43 do<strong> IP66</strong>. Szukasz plafonu do innych pomieszczeń w domu? Oferujemy zwykłe plafony LED w szerokim wyborze stylizacyjnym.</p><p>Oferujemy produkty polskiej marki Elgo i innych cenionych producentów. </p><p>Zapraszamy do zapoznania się z innymi produktami w naszym sklepie, przygotowaliśmy doskonałe oferty na różne rodzaje oświetlenia - żyrandol, kinkiet led czy lampę stojącą.</p>','plafony-hermetyczne-led','','',''),(83,1,1,'plafony z czujnikiem ruchu','<p>Plafon sprawdza się wszędzie tam, gdzie potrzebujemy funkcjonalnej oprawy oświetleniowej. Niski profil oprawy sprawia, że doskonale sprawdzają się w pomieszczeniach niskich lub wąskich nie sprawiając wrażenia nadmiernego przytłoczenia. Plafony LED to również oszczędność energii. Przy wykorzystaniu źródeł światła LED możemy zaoszczędzić do 80% energii. Również dzięki technologii możliwe jest wyposażenie plafonów w dodatkowe elementy takie jak czujnik ruchu lub zmierzchu, co dodatkowo podnosi funkcjonalność oprawy i pozwala na jej zastosowanie wszędzie tam, gdzie potrzebujemy bezdotykowej obsługi oświetlenia i w pełni zautomatyzowanych procesów.</p><h3>Plafony z czujnikiem ruchu w sklepie LamPy</h3><p>Poniżej prezentujemy popularne <strong>oprawy sufitowe</strong> typu <strong>plafon LED</strong> z zamontowanym <strong>czujnikiem ruchu</strong>. Dzięki temu oprawa staje się praktycznie bezkosztowa w eksploatacji, a jej różne kształty, moc i barwa światła pozwalają na dopasowanie do wszelkich potrzeb, takich jak<strong> klatki schodowe</strong>, czy pomieszczenia, w których nie ma potrzeby ciągłego oświetlenia.</p><p>Oprawy wystepują <strong>z czujnikami ruchu typu PIR </strong>[Passive Infra Red], które <strong>wykrywają ruch w paśmie podczerwieni</strong> (nie może być żadnych barier ) lub z <strong>czujnikami mikrofalowymi HF</strong> [High Frequency] któe przenikają przez plastik, drewno, szkło i inne cienkie materiały dzieki czemu mogą one być zamontowane w niewidocznych miejscach np. w suficie podwieszanym.</p>','plafony-z-czujnikiem-ruchu','','','');
