INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Dostawa','','Zasady realizowanej dostawy','warunki, dostawa, dostawy, opóźnienie, wysyłka, paczka','<h2>Dostawy i zwroty</h2>\n<h3>Wysyłka Twojej Przesyłki</h3>\n<p>Paczki są w głównej mierze wysyłane w przeciągu dwóch dni od zaksięgowania płatności. Jakikolwiek sposób dostawy nie zostałby wybrany, dostarczymy link do śledzenia przesyłki.</p>\n<p>Koszta wysyłki zawierają obsłużenie, pakowanie jak i koszty pocztowe. Opłaty związane z obsługą paczki są stałe, zaś koszt transportu zależy od całkowitej wagi przesyłki. Polecamy zamawiać produkty grupowo.</p>','dostawa'),(2,1,1,'Nota prawna','','Nota prawna','notka, prawna','<h2></h2>\n<h2>Nota prawna</h2>\n<p><span style=\"font-size:10pt;\">Wszystkie materiały i opublikowane na tej stronie informacje (w szczególności teksty, zdjęcia, utwory audiowizualne) stanowią przedmiot prawa autorskiego i przysługują wskazanemu wyżej podmiotowi (dalej: Sprzedawca) lub wykorzystywane są przez Sprzedawcę za zgodą ich właścicieli. Powielanie, rozpowszechnianie lub publiczne odtwarzanie możliwe jest wyłącznie za zgodą Sprzedawcy. Wyrażona zgoda nie może zostać przeniesiona na inne podmioty oraz może być w każdym czasie odwołana.<br /><br />Sprzedawca nie odpowiada za treści udostępniane na innych stronach internetowych, do których linki znajdują się na stronie Sprzedawcy. W momencie umieszczania linków zewnętrznych na naszej stronie nie zauważyliśmy pod docelowym adresem treści naruszających prawo. Jednakże nie ponosimy odpowiedzialności za istnienie takich treści na innych stronach internetowych, ponieważ strony te nie stanowią prezentacji naszych treści, oraz nie przejmujemy na siebie obowiązku ich sprawdzania i nadzoru nad nimi.</span></p>\n<p><span style=\"font-size:10pt;\"></span></p>\n<p><span style=\"font-size:10pt;\">Serwis został wygenerowany przy pomocy PrestaShop.</span></p>','nota-prawna'),(3,1,1,'Warunki korzystania','','Warunki korzystania ze sklepu internetowego Lampy','korzystania, użycie, sprzedaż, warunki','<h2>Zasady korzystania ze sklepu</h2>\n<h3>Zasada 1</h3>\n<p>Sklep otwarty będzie tylko i wyłącznie podczas prezentacji projektu z przedmiotu Biznes Elektroniczny, oraz okazjonalnie, gdy będą nad nim prowadzone prace.</p>\n<p></p>','warunki-korzystania'),(4,1,1,'O nas','','Dowiedz się o nas więcej','about us, informations','<h2>O nas</h2>\n<h3>Nasza działalność</h3>\n<p>Jesteśmy zespołem studentów - specjalistów, dla których założenie sklepu z oświetleniem to żaden problem.</p>\n<h3>Nasz zespół</h3>\n<p>Tomasz, Jakub i Dominik to cały nasz zespół.</p>','o-nas'),(5,1,1,'Bezpieczne płatności','','Sposoby płatności akceptowane w naszym sklepie','paypal, płatności, visa, przelew','<h2>Bezpieczne płatności</h2>\n<p>W naszym sklepie oferujemy bezpieczne metody płatności.</p>\n<p></p>','bezpieczne-platnosci');
